import React, { useState, useEffect } from "react";
import "./tweet.css";
function Twitter() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("http://localhost:3001/api/data")
            .then(response => response.json())
            .then(data => setData(data));
    }, []);
    return (
        <div>
            <div className="search">
                <input className="input" type="text" placeholder="Search.." />
                &nbsp;
                <button type="button" className="button" onclick="submit">Search</button>
            </div>
            <div>
                {data.map(data => (
                    <div className="grid_data ">
                        <div className="box" key="data.id">
                            <strong>URL: </strong>{data.url}<br />
                            <strong>data_link: </strong>{data.data_link}<br />
                            <strong>User_id: </strong>{data.user_id}<br />
                            <strong>Hastag: </strong>{data.hastag}<br />
                            <strong>Redata_count: </strong>{data.redata_count}<br />
                            <strong> Share_count: </strong>{data.share_count}<br />
                            <strong>Description: </strong>{data.description}<br />
                            <strong>Following: </strong>{data.following}<br />
                            <strong>Followers: </strong>{data.followers}
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Twitter;
